"""
字符串中的第一个唯一字符
给定一个字符串，找到它的第一个不重复的字符，并返回它的索引。如果不存在，则返回 -1。
"""
import time
from collections import Counter
class Solution:
    def firstUniqChar(self, s: str) -> int:
        num = Counter(s)
        for i in s:
            if(num[i] == 1):
                return s.index(i)
        return -1

if __name__ == '__main__':
    s = Solution()

    print(s.firstUniqChar(""))
